export function getForecast() {
    return fetch('https://localhost:44396/weatherforecast/forecast?city=zambrow&countryCode=pl', { headers: {
      'ClientId': 'Bob',
      'content-type': 'application/json'
    }})
      .then(
        data => data.json().then(data => console.log(data))
        )
  }
